column8:
いつの時代も恐竜好きな男の子は多いものです。本書は恐竜をテーマにしたLaQ公式ガイドブック。
 大きな恐竜、すばしっこい恐竜、水中の恐竜など、さまざまな恐竜をリアルにカッコよく作れる設計図を
収録しました。また、羽毛恐竜など最新の学説を取り入れたモデルも掲載。LaQで楽しく遊びながら、
 恐竜についての知識も深まる1冊になっています。

 【編集部からのコメント】
 本書に収録する恐竜モデルの撮影時に、
 「アンモナイトをくわえて泳ぐモササウルス」
 「ティラノサウルスと対峙するトリケラトプス」など、
 自分が小さい頃に読んだ恐竜図鑑のページがよみがえってきました。
 昔も今も、男の子って恐竜が好きですよね。
 本書を頼りにぜひ自分の手で迫力ある恐竜モデルを組み立ててください。
 満足感を味わえること間違いなしです！<style>
