本書は「のりもの」をテーマにしたLaQ公式ガイドブック。町で見かけるクルマや電車、大きくて魅力ある
飛行機、船、そして夢の宇宙船まで、わかりやすい設計図で多彩なモデルを作ることができます。
タイヤパーツ「ハマクロンmini」を効果的に使った、動く、走る、変形するなど、作ったあとも遊びが
広がる「のりもの」がたくさん。新発売のクリアパーツを使えば、さらにかっこよくてリアルなモデルに
仕上がります。

 【編集部からのコメント】
 男の子が大好きな「のりもの」をLaQで再現。手軽に作れるコンパクトモデルから迫力の大型モデルまで、
 幅広く収録しました。完成したあとも走らせたり変形させたりして、遊びの幅がどんどん広がります。<style>
