LaQブロックでロボやメカを作って遊ぶ本 

 日本製の知育ブロック玩具として大手書店などで販売され、幼稚園や保育園へも幅広く導入されていて子ども達に大人気の、組み立てブロックのLaQ(ラキュー)をテーマにしたスペシャルムックの第5弾です。
5歳から小学校低学年という、LaQファンの子ども達の年齢層をターゲットにしたエントリームック本ですので、この本だけのオリジナル付録キットの魅力とあわせて、ブロック遊びが大好きな子供達に楽しんでもらえることと思います。
2015年秋発売の新作LaQキット「ビルドアップロボ」シリーズに登場するキャラクターほか、ロボット、飛行機、クルマ、ロケットなど、最新メカの平面・立体モデルが、別売りのLaQパーツともあわせれば作れます。ビルドアップロボを主人公にしたカラーまんがストーリーも掲載して、お話を読んで楽しんで、作って遊べる本になります。<style>
